@Injectable({
  providedIn: 'root'
})
export class ServiceService  implements OnInit{

  WeatherData:any;

  constructor() {




   }
  ngOnInit(): void {


  }


   getWeatherData(){

    let data = ' {"temp": 300.14,"feels_like": 301.59,"temp_min": 299.09,"temp_max": 300.14,"pressure": 1015,"humidity": 65}';

    //let data = 'hello';
    this.setWeatherData(data);
  }

  setWeatherData(data: any){
    this.WeatherData=JSON.parse(data);
    this.getWeatherData();
    console.log(this.WeatherData);

  }
}
